import React from 'react'
import menuClose from '../images/header/menuClose.png'
import { items } from './MenuItems.js'
const Menu = () => {
	return (
		<div className='menu'>
			<img src={menuClose} className='menuClose'></img>
			<div className='menuItems'>
				{items.map((title, link) => (
					<a href={link}>{title}</a>
				))}
			</div>
		</div>
	)
}

export default Menu
